import React from "react";
import "./App.css";
import Customer from "./components/Customer";

const customers = [
  {
    id: 1,
    image: "https://placeimg.com/64/64/any",
    name: "조성일",
    birthday: "920920",
    gender: "남자",
    job: "개발자"
  },
  {
    id: 2,
    image: "https://placeimg.com/64/64/any",
    name: "조성일",
    birthday: "920920",
    gender: "남자",
    job: "개발자"
  },
  {
    id: 3,
    image: "https://placeimg.com/64/64/any",
    name: "조성일",
    birthday: "920920",
    gender: "남자",
    job: "개발자"
  }
];

function App() {
  return (
    <Customer
      id={customer.id}
      image={customer.image}
      name={customer.name}
      birthday={customer.birthday}
      gender={customer.gender}
      job={customer.job}
    />
  );
}

export default App;
